import React, { useState } from "react";
import Table from "../../../ui/Table/Table";
import { AgGridColumn } from "ag-grid-react";
import { Link } from "react-router-dom";
import { Button } from "@material-ui/core";
import AddIcon from "@material-ui/icons/Add";
import { makeStyles } from "@material-ui/styles";
import IconButton from "@material-ui/core/IconButton";
import DeleteIcon from "@material-ui/icons/Delete";
import SelectEquipment from "../selectEquipment/selectEquipment";
import { useSelector } from "react-redux";

const ParameterStyles = makeStyles({
  dropdown: {
    display: "flex",
    alignItems: "center",
    flexDirection: "row",
    marginBottom: "10px",
  },
});
function ParameterEstimation(props) {
  debugger;
  const [gridApi, setGridApi] = useState(null);
  const [selectedEquipmentList, setSelectedEquipmentList] = useState([]);
  const ParameterClasses = ParameterStyles();
  const [rowState, setRows] = useState([]);
  let systemRepairTypeBool = false;
  const systemConfigurationTreeData = useSelector(
    (state) => state.treeData.treeData
  );
  if (systemConfigurationTreeData.length > 0) {
    const equipment = systemConfigurationTreeData.filter(
      (x) => x.parentId === null
    )[0];
    systemRepairTypeBool =
      equipment.repairType === "Replaceable" ? true : false;
  }
  let ParameterColumns = [];
  if (!systemRepairTypeBool) {
    //Repairable Data
    ParameterColumns = [
      <AgGridColumn
        field="EquipmentName"
        headerName="Equipment Name"
        minWidth={200}
        editable={true}
      />,
      <AgGridColumn
        field="alpha"
        headerName="alpha"
        minWidth={200}
        type="number"
        editable={false}
      />,
      <AgGridColumn
        field="beta"
        headerName="β"
        minWidth={200}
        type="number"
        editable={false}
      />,
    ];
  } else {
    ParameterColumns = [
      <AgGridColumn
        field="EquipmentName"
        headerName="Equipment Name"
        minWidth={200}
        editable={true}
      />,
      <AgGridColumn
        field="eta"
        headerName="η-Scale Parameter"
        minWidth={200}
        type="number"
        editable={false}
      />,
      <AgGridColumn
        field="beta"
        headerName="β-Shape Parameter"
        minWidth={200}
        type="number"
        editable={false}
      />,
    ];
  }

  const onHandleSubmitClick = () => {
    console.log("Hurray");
    const rowD = selectedEquipmentList.map((ele) => {
      if (!systemRepairTypeBool) {
        return {
          id: ele.id,
          EquipmentName: ele.name,
          alpha: "-",
          beta: "-",
        };
      } else {
        return {
          id: ele.id,
          EquipmentName: ele.name,
          eta: "-",
          beta: "-",
        };
      }
    });
    setRows(rowD);
  };

  const onUpdateSelectedEquipmentList = (d) => {
    setSelectedEquipmentList(d);
  };

  const updateFinalRowData = (allRows) => {
    console.log("This");
    console.log(allRows);
  };
  const onHandleUpdateEtaBetaDB = () => {
    fetch("/update_parameters", {
      method: "POST",
      body: JSON.stringify({
        data: rowState,
        isReplacable: systemRepairTypeBool,
      }),
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json",
      },
    })
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        setRows(data);
      });
  };

  return (
    <div>
      <div className={ParameterClasses.dropdown}>
        <div>
          <SelectEquipment
            list={props.list}
            onUpdateSelectedEquipmentList={onUpdateSelectedEquipmentList}
          />
        </div>
        <div>
          <Button
            variant="contained"
            color="primary"
            style={{ marginLeft: "20px" }}
            onClick={onHandleSubmitClick}
          >
            Submit
          </Button>

          <Button
            variant="contained"
            color="primary"
            style={{ marginLeft: "20px" }}
            onClick={onHandleUpdateEtaBetaDB}
          >
            Update Parameters from Database
          </Button>

          {/* <Button
            variant="contained"
            color="primary"
            style={{ marginLeft: "20px" }}
            onClick={onHandleUpdateEtaBetaDB}
          >
            Update Parameters from Database
          </Button> */}
        </div>
      </div>
      <div>
        <Table
          columnDefs={ParameterColumns}
          setGrid={setGridApi}
          gridApi={gridApi}
          rowData={rowState}
          tableUpdate={updateFinalRowData}
        ></Table>
        <div>
          <Button
            style={{ float: "right" }}
            variant="contained"
            color="primary"
            startIcon={<AddIcon />}
            component={Link}
            to="/data_manager/historical_data"
          >
            Add Data
          </Button>
        </div>
      </div>
      {/* <Button
        variant='contained'
        startIcon={<AddIcon />}
        color="secondary"
        onClick={()=>AddRow()}
        >Add Row</Button>
        <IconButton>
        <DeleteIcon />
        </IconButton> */}
    </div>
  );
}

export default ParameterEstimation;
